// Email address
// Link to a PDF version of your CV
// Link to your GitHub profile
// Link to your LinkedIn page
// Must have a contact form for handling events

function Contact() {


  return (
    <div className="contact">
      <h1>Contact</h1>
      <p>Email: <a href="mailto:michmatu@protonmail.com">michmatu@protonmail.com</a></p>
        <p><a href="cv.pdf">CV</a></p>
        <p><a href="www.github.com/michmatu">GitHub</a></p>
        <p><a href="www.linkedin.com/in/michmatu">LinkedIn</a></p>
</div> );
}

export default Contact;
